(1, 1, 'I cant get this done, check out attached file', '9,11,12', 725, '2017-07-14 17:39:28'),
(2, 1, 'Please can you have a look at this. Its been an hour since I\'m trying to get this done. Ignore my previous uploads, download the attached file and look the the marked area. Please let me know if this can be resolved ASAP.', '9', 725, '2017-07-16 05:23:47'),
(3, 1, 'Sure, allow us a few hours. We are looking into this. I\'ll respond you as soon as we have an answer.', '', 1, '2017-07-16 05:26:29'),
(4, 2, 'Please check my credit logs, I\'m getting an error', '', 725, '2018-02-17 19:55:17'),
(5, 1, 'I have done some changes, can you confirm if you\'re still facing the issue?', '', 1, '2018-02-17 20:39:37'),
(6, 1, 'Please revert if I should close this ticket???', '', 1, '2018-02-17 20:42:16'),
(7, 1, 'Your answer will be highly appreciated.', '', 1, '2018-02-17 20:42:34'),
(8, 3, 'Please advise if you are capable of handling 24x7 support requests.', '', 735, '2019-08-08 13:58:05'),
(9, 3, 'Hello Yira, our support is available only during working hours.', '', 721, '2019-08-08 14:01:43'),
(10, 4, 'I just wanted to make sure you are available now. I need some agreement to get approved by tonight.', '', 726, '2019-08-08 17:04:10'),
(11, 4, 'Usually I\'m not available during this hour but today I am. Please send over the file.', '', 721, '2019-08-08 17:17:01'),
(12, 5, 'Hello as per our telephonic conversation, can you get the approval now. have you confirmed with your seniors like you said? Please let me know', '', 731, '2019-08-08 17:43:48'),
(13, 5, 'I am uploading the agreement please review it asap', '', 731, '2019-08-08 17:44:25'),
(14, 5, 'Yes I am available, can you give me a minute. Also I have confirmed it will be done. Send over the file', '', 726, '2019-08-08 17:48:45'),
(15, 5, 'I have sent please check document section', '', 731, '2019-08-08 17:49:19'),
(16, 4, 'Ok Thanks, I am sending an agreement. Please verify its correct or not, if it is kindly approve it.', '', 726, '2019-08-08 17:53:44'),
(17, 4, 'Done!!', '', 721, '2019-08-08 18:00:48'),
(18, 5, 'I have checked and got it confirmed. We\'re good.', '', 726, '2019-08-08 18:02:27'),
(19, 5, 'Thanks for your kind support', '', 731, '2019-08-08 18:03:22'),
(20, 6, 'I am observing blank pages from time to time. Please check, specially on DLR reports page.', '', 736, '2019-10-06 17:20:44'),
(21, 6, 'Can you send screenshots please', '', 732, '2019-10-20 04:18:45');
